#[derive(Serialize, Deserialize)]
enum AbdMsg { Query(TestRequestId), AckQuery(TestRequestId, Seq, TestValue), Replicate(TestRequestId, Seq, TestValue), AckReplicate(TestRequestId),
} The current implementation combines the roles of "replica" and "coordinator that accepts a request and facilitates replication." seq and val are for the first role, while phase tracks information needed by the second role. Of particular note is that for phase 1, writes need to remember what value to later replicate, which is stored in write. Conversely for phase 2, reads need to remember what value to later return to the client, which is stored in read. #[derive(Clone, Debug, Eq, Hash, PartialEq)]
struct AbdState { seq: Seq, val: TestValue, phase: Option<AbdPhase>,
} #[derive(Clone, Debug, Eq, Hash, PartialEq)]
enum AbdPhase { Phase1 { request_id: TestRequestId, requester_id: Id, write: Option<TestValue>, // `None` for read responses: HashableHashMap<Id, (Seq, TestValue)>, }, Phase2 { request_id: TestRequestId, requester_id: Id, read: Option<TestValue>, // `None` for write acks: HashableHashSet<Id>, },
} type Seq = (WriteCount, Id); // `Id` for uniqueness
type WriteCount = u64; We are now ready to implement the protocol. Note that the implementation intentionally avoids decomposing the message handlers into different function calls because each call needs to manage shared actor state. Spreading state mutation across multiple locations in the source code arguably makes the implementation harder to follow (much like mutable global variables), and functions are only used where they can be reasoned about locally. An alternative composition strategy that does often work well for actor systems involves distinguishing roles so that each has less state (having different AbdServer and AbdReplica actors for example), although we will not do that for this short example. The next chapter on the other hand will demonstrate how to compose a system of different actor types. #[derive(Clone)]
struct AbdActor { peers: Vec<Id>,
} impl Actor for AbdActor { type Msg = RegisterMsg<TestRequestId, TestValue, AbdMsg>; type State = AbdState; fn on_start(&self, _id: Id, _o: &mut Out<Self>) -> Self::State { AbdState { seq: (0, Id::from(0)), val: '?', phase: None, } } fn on_msg(&self, id: Id, state: &mut Cow<Self::State>, src: Id, msg: Self::Msg, o: &mut Out<Self>) { use RegisterMsg::*; match msg { Put(req_id, val) if state.phase.is_none() => { o.broadcast(&self.peers, &Internal(Query(req_id))); state.to_mut().phase = Some(AbdPhase::Phase1 { request_id: req_id, requester_id: src, write: Some(val), responses: { let mut responses = HashableHashMap::default(); responses.insert(id, (state.seq, state.val.clone())); responses }, }); } Get(req_id) if state.phase.is_none() => { o.broadcast(&self.peers, &Internal(Query(req_id))); state.to_mut().phase = Some(AbdPhase::Phase1 { request_id: req_id, requester_id: src, write: None, responses: { let mut responses = HashableHashMap::default(); responses.insert(id, (state.seq, state.val.clone())); responses }, }); } Internal(Query(req_id)) => { o.send( src, Internal(AckQuery(req_id, state.seq, state.val.clone()))); } Internal(AckQuery(expected_req_id, seq, val)) if matches!(state.phase, Some(AbdPhase::Phase1 { request_id, .. }) if request_id == expected_req_id) => { let mut state = state.to_mut(); if let Some(AbdPhase::Phase1 { request_id: req_id, requester_id: requester, write, responses, .. }) = &mut state.phase { responses.insert(src, (seq, val)); if responses.len() == majority(self.peers.len() + 1) { // Quorum reached. Move to phase 2. // Determine sequencer and value. let (_, (seq, val)) = responses.into_iter() .max_by_key(|(_, (seq, _))| seq) .unwrap(); let mut seq = *seq; let mut read = None; let val = if let Some(val) = std::mem::take(write) { seq = (seq.0 + 1, id); val } else { read = Some(val.clone()); val.clone() }; o.broadcast( &self.peers, &Internal(Replicate(*req_id, seq, val.clone()))); state.seq = seq; state.val = val; let mut acks = HashableHashSet::default(); acks.insert(id); state.phase = Some(AbdPhase::Phase2 { request_id: *req_id, requester_id: std::mem::take(requester), read, acks, }); } } } Internal(Replicate(req_id, seq, val)) => { o.send(src, Internal(AckReplicate(req_id))); if seq > state.seq { let mut state = state.to_mut(); state.seq = seq; state.val = val; } } Internal(AckReplicate(expected_req_id)) if matches!(state.phase, Some(AbdPhase::Phase2 { request_id, .. }) if request_id == expected_req_id) => { let mut state = state.to_mut(); if let Some(AbdPhase::Phase2 { request_id: req_id, requester_id: requester, read, acks, .. }) = &mut state.phase { acks.insert(src); if acks.len() == majority(self.peers.len() + 1) { let msg = if let Some(val) = read { GetOk(*req_id, std::mem::take(val)) } else { PutOk(*req_id) }; o.send(*requester, msg); state.phase = None; } } } _ => {} } }
