The code starts by implementing a simple server using the " actor model ." An actor is an event oriented process that is able to communicate with other actors over a network by sending messages. The server responds to Put and Get messages based only on its own local state, providing its clients with a simple form of distributed storage, sometimes known as a shared register . Responses are linked to requests via a request ID chosen by the client. Stateright must have visibility of every actor/input output to facilitate enumerating possible system behaviors. That means the actor should only interface with the outside world via events passed by the Stateright framework. state: &mut Cow<Self::State> is a clone-on-write smart pointer keeping track of whether the actor's internal state changed while o: &mut Out<Self> is a container recording output/commands. Commands recorded by methods such as Out::send(...) do not take effect until the method returns. type RequestId = u64; #[derive(Clone)]
struct ActorContext; impl Actor for ActorContext { type Msg = RegisterMsg<RequestId, char, ()>; type State = char; fn on_start(&self, _id: Id, _o: &mut Out<Self>) -> Self::State { '?' // default value for the register } fn on_msg(&self, _id: Id, state: &mut Cow<Self::State>, src: Id, msg: Self::Msg, o: &mut Out<Self>) { match msg { RegisterMsg::Put(req_id, value) => { *state.to_mut() = value; o.send(src, RegisterMsg::PutOk(req_id)); } RegisterMsg::Get(req_id) => { o.send(src, RegisterMsg::GetOk(req_id, **state)); } _ => {} } }
} A test follows. It employs a technique called model checking that is similar to property based testing , wherein the programmer writes a predicate indicating what constitutes correct behavior; for example, " the function's output is a sorted permutation of its input ." But whereas property based testing often enumerates the outputs of a deterministic algorithm based on a random sampling of possible inputs, model checking often systematically enumerates the reachable states of a nondeterministic system with less focus on the variety of initial inputs; for example " if clients write X followed by Y to the the same database key K, then a subsequent read may only return Y until the next write, regardless of how the network reorders or redelivers messages ." The test checks the system for a property called linearizability , which loosely speaking means that the visible behavior of the register emulated by the actor system is identical to that of a register within a single-threaded system. In the words of the individuals who coined the term: Linearizability provides the illusion that each operation applied by concurrent processes takes effect instantaneously at some point between its invocation and its response, implying that the meaning of a concurrent object’s operations can be given by pre- and post-conditions. Maurice Herlihy and Jeannette Wing, in Linearizability: A Correctness Condition for Concurrent Objects An important aspect of linearizability is the notion of a "sequential specification," which serves as a reference for correct behavior of the system. In other words, the system emulates the sequential specification. For instance, the sequential specification could indicate: the system behaves like a memory cell (i.e. register semantics), the system behaves like a queue, or the system behaves like a stack. That means that when someone indicates that a system is linearizable, it is important to keep in mind the question "linearizable with respect to what ?" In this chapter, the sequential specification is register semantics, provided by Stateright, but later chapters will involve other sequential specifications. Terminology : The term "linearizable" derives from the insight that the operations executed by a system form a directed acyclic graph (a partial order) where edges indicate "happens before." For example, if Computer1 sends messages to invoke operations on Computer2 and Computer3, then the message sends happens before Computer2 or Computer3 handle them, but the handling of the messages by Computer2 and Computer 3 lack a defined order because the messages race . A "linearization" defines a viable linear order of seemingly atomic events such as "Computer 1 sends the messages, Computer 3 handles one, and then Computer2 handles the other." A system is not linearizable when its behavior cannot be mapped to a linearization. For example, if the operation invoked on Computer2 was Append "Hello" and Computer3 was Append "World", but the final value interlaced the inputs to form "WolloHerld", then the system would not be linearizable. Either "HelloWorld" or "WorldHello" on the other hand would be valid linearizations since the messages race. While this kind of understanding is not needed to validate a system for linearizability, it will assist you in debugging when Stateright indicates that a system is not linearizable. The test leverages RegisterTestSystem , which is built into Stateright and defines a system whereby a specified number of clients (only 1 in this case) write distinct values and independently read values without coordinating with one another. Under the hood RegisterTestSystem also leverages Stateright's built-in LinearizabilityTester . Stateright is able to find a bug that arises even if there is only a single client. The bug manifests whenever the network redeliveries messages, something that can and does happen in practice. #[test] fn is_unfortunately_not_linearizable() { let checker = RegisterTestSystem { 